     template<typename Fr>
     class EleventhPower_SBox {
     public:
          static Fr compute(const Fr& val)
          {
               const auto val_x2 = val * val;
               const auto val_x4 = val_x2 * val_x2;
               const auto val_x8 = val_x4 * val_x4;
               const auto val_x10 = val_x8 * val_x2;
               return val * val_x10;
          }
     };

     template<typename Fr>
     class ThirteenthPower_SBox {
     public:
          static Fr compute(const Fr& val)
          {
               const auto val_x2 = val * val;
               const auto val_x4 = val_x2 * val_x2;
               const auto val_x8 = val_x4 * val_x4;
               const auto val_x12 = val_x8 * val_x4;
               return val * val_x12;
          }
     };

     template<typename Fr>
     class FifthPower_SBox {
     public:
          static Fr compute(const Fr& val)
          {
               const Fr val2 = val*val;
               const Fr val4 = val2*val2;
               return val4 * val;
          }
     };

     template<typename Fr>
     class ThirdPower_SBox {
     public:
          static Fr compute(const Fr& val)
          {
               return val*val*val;
          }
     };

